      onFileChange: function (oEvent) {
        // Handle file selection event
        var oUploadCollection = oEvent.getSource();
        var aFiles = oEvent.getParameter("files");
        for (let i = 0; i < aFiles.length; i++) {
          // Add file to UploadCollection
          oUploadCollection.addItem(
            new UploadCollectionItem({
              fileName: aFiles[i].name,
            })
          );
        }
      },

      onUpload: function () {
        // Perform the upload
        if (this.oUploadCollection) {
          this.oUploadCollection.upload();
        }
      },

      onUploadComplete: function (oEvent) {
        // Handle upload completion event
        var aUploadedFiles = oEvent.getParameter("files");

        aUploadedFiles.forEach(function (oFile) {
          // MessageToast.show("Uploaded file: " + oFile.fileName);
        });

        // Clear the UploadCollection after upload
        if (this.oUploadCollection) {
          this.oUploadCollection.removeAllItems();
        }
        // this.oUploadDialog.close();
        WorkflowService.postData();
        var that = this;

        this._Extraction_busyDialog.open();

        // Simulate file processing after 5 seconds
        setTimeout(
          function () {
            this._Extraction_busyDialog.close();
            this._Fetching_busyDialog.open();

            // Simulate more processing if needed
            setTimeout(
              function () {
                WorkflowService.getData().then(function (oResponse) {
                  console.log(oResponse);

                  var aPrev = that
                    .getView()
                    .getModel()
                    .getProperty("/ProductCollection");
                  oResponse[0].TradeNumber = "T1234";
                  oResponse[0].currentDate = "08/06/2024";
                  oResponse[0].SenderName = "Telecommunications";
                  oResponse[0].DocumentNumber = oResponse[0].DocumentNumber;

                  aPrev.push(oResponse[0]);
                  that
                    .getView()
                    .getModel()
                    .setProperty("/ProductCollection", aPrev);
                });

                this._Fetching_busyDialog.close();
              }.bind(this),
              5000
            ); // Example: Fetching file might take 3 seconds
          }.bind(this),
          5000
        ); // Wait for 5 seconds to change the text
      },

